    (120-350 m water depths) was mosaiced from data collected in 2002.An Edgetech DF1000
    side scan system was used for geophysical surveying using only the 100Khz data.
    A Trimble DSM212Hdifferential GPS was used for positioning. Navigation from the
    GPS and Gyro were logged in Hypack version 005B (CoastalOceanographics). Isis Sonar
    (Triton Imaging) was used to log the digital sonar packets and cable counter data.
